import sys
import random

def get_next_turn(key):
    if key not in chromosome:
        return 'liar'

    value = random.randint(0, 100)
    total = 0
    
    for t, v in chromosome[key]:
        if value >= total and value <= (total + v):
            return t
        total += v
        
    return 'liar'
        
def proc_input(input):
    input = input.strip()
    
    if input.startswith('win') or input.startswith('loss'):
        return
        
    input = input.replace('*', '6').split(' ')
    myDice = int(input[0])
    if len(input) > 1:
        turns = tuple([(int(x[0]), int(x[1])) for x in input[1].split(',')])
        if len(turns) % 2 == 0:
            myTurnFirst = 1
        else:
            myTurnFirst = 0
    else:
        turns = tuple()
        myTurnFirst = 1

    return get_next_turn((myDice, myTurnFirst, turns))
       
def main():
    line = sys.stdin.readline()
    while line:
        result = proc_input(line)
        
        if not result:
            line = sys.stdin.readline()
            continue
        elif result == 'liar':
            print('liar', flush=True)
        else:
            print(('%s%s' % (result[0], result[1])).replace('6', '*'), flush=True)
        
        line = sys.stdin.readline()
    
if __name__ == "__main__":
    main()
    